func CommTransCamel(s string) string {
	arr := make([]string, 0)
	pre := 0
	cur := 0
	for ; cur < len(s); cur++ {
		if s[cur] >= 'A' && s[cur] <= 'Z' {
			arr = append(arr, s[pre:cur])
			pre = cur
		}
	}
	arr = append(arr, s[pre:cur])
	save := make([]string, 0)
	for i := 0; i < len(arr); i++ {
		if len(arr[i]) > 0 {
			save = append(save, strings.ToUpper(arr[i]))
		}
	}
	return strings.Join(save, "_")
}

