// strsplit
func CommStringSplit(str string, splits []string) []string {
	ss := []string{str}
	for i := 0; i < len(splits); i++ {
		tt := make([]string, 0)
		for j := 0; j < len(ss); j++ {
			sp := strings.Split(ss[j], splits[i])
			tt = append(tt, sp...)
		}
		ss = tt
	}
	return ss
}
